import React, { useCallback, useEffect, useMemo, useState } from 'react';
import { TableC } from '../../components/Table/TableC';
// import { DEALERS, DEALERS_COLUMN, STATES } from '../../assets/Json/DEALERS';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faEye, faTrash } from '@fortawesome/free-solid-svg-icons';
import axios from 'axios';

const Dealers = () => {
  const [responseData, setResponseData] = useState([
    { id: '', name: '', city: '', state: '', contact: '' },
  ]);
  const loadDealer = useCallback(async () => {
    await axios
      .get('http://localhost:3003/dealers')
      .then((response) => {
        setResponseData(response.data);
        return null;
      })
      .catch((error) => {
        console.log(error);
      });
  }, [setResponseData]);
  useEffect(() => {
    loadDealer();
  }, [loadDealer]);
  // const columns = useMemo(() => DEALERS_COLUMN, []);

  // const data = useMemo(() => DEALERS, []);
  const DEALERS_COLUMN = [
    {
      Header: '#',
      accessor: 'id',
    },
    { Header: 'Name', accessor: 'name' },
    { Header: 'City', accessor: 'city' },
    { Header: 'State', accessor: 'state' },
    { Header: 'Contact No.', accessor: 'contact' },
    {
      Header: 'Actions',
      accessor: 'action',
      disableSortBy: true,
      Cell: () => {
        return (
          <div className='d-flex justify-content-around'>
            <span
              onClick={() => {
                return null;
              }}>
              <FontAwesomeIcon className='icon' icon={faEye} />
            </span>

            <span
              onClick={() => {
                return null;
              }}>
              <FontAwesomeIcon className='icon' icon={faTrash} />
            </span>
          </div>
        );
      },
    },
  ];
  return (
    <>{console.log('responseData', responseData)}</>
    // <TableC
    //   columns={columns}
    //   searchTitle='Dealer'
    //   searchPlaceHolder='Search Dealer'
    //   dropdownList={STATES}
    //   data={data}
    //   heading="Dealer's List"
    //   bordered={true}
    //   filter='name'
    //   dropfilter='state'
    // />
  );
};

export default Dealers;
